! function() {
    "use strict";

    function mapSG() {
        e(1.2967417, 103.7866636, "map-singapore")
    }
    function mapMY() {
        e(3.0838205, 101.526588, "map-malaysia")
    }

    function e(o, e, n) {
        var a = new google.maps.LatLng(o, e),
            t = {
                zoom: 17,
                center: a,
                mapTypeControl: !1
            },
            g = new google.maps.Map(document.getElementById(n), t);
        new google.maps.Marker({
            position: a,
            map: g
        })
    }
    google.maps.event.addDomListener(window, "load", mapSG);
    google.maps.event.addDomListener(window, "load", mapMY);
}();
